local infoLabel = Instance.new("TextLabel")
infoLabel.Size = UDim2.new(0, 150, 0, 35) -- ch·ªØ r√µ h∆°n
infoLabel.Position = UDim2.new(1, -160, 0, 10) -- g√≥c ph·∫£i tr√™n
